import React from 'react';
import { link } from 'react-router-dom';

import './Header.styles.scss';

const Header = () => (
    <div className='header'>
        <div className="logo">
            <link to='/'>
            &nbsp;
            </link>
            </div>
        <div className="options">
            <link className='option' to='/shop'>
                SHOP
            </link>
        </div>

        <div className="options">
            <link  className="option" to='/shop'>
                CONTACT
            </link>
        </div>
    </div>
)

export default Header;
